INSERT INTO `articol` VALUES
(1,'echipa','minge','fotbal','vara',39,'',100,'  Este realizata din piele sintetica de poliuretan de inalta calitate si cusuta manual.\r\n  Folosita in intreaga lume de zeci de ani de catre amatori si profesionisti, pentru antrenament si pentru meciuri.\r\nMarimea 5 FIFA Basic',1),
(2,'echipa','minge','fotbal','vara',40,'FIFA',150,'  Minge conceputa pentru antrenamente sau recreere.\r\nCaracteristici\r\n    Este fabricata din piele sintetica \r\n    Camera interioara ZERO WING asigura rotunjimea perfecta.\r\n    Mingea este cusuta .\r\n    O suprafata placuta la atingere\r\nMarimea 5.\r\n',2),
(3,'echipa','minge','baschet','sala',38,'molten',50,'    Minge baschet agrement,antrenament\r\n    Turnata, 10 panouri\r\n    Camera: butyl\r\n    Material: cauciuc permalast\r\n    Aderenta si usor de manevrat\r\n    Numar: 7, pentru barbati\r\n    Dimensiuni: 749 -780 mm',3),
(4,'echipa','minge','baschet','sala',40,'Mikasa',25,'Minge baschet competitie, nivel mondial, oficiala FIBA, pentru toate turneele\r\nMaterial suprafata: piele naturala premium, textura autentica\r\nStrat suplimentar de spuma  pentru amortizare, mingea este mai soft, usor de controlat\r\nINDOOR (pentru sala, interior)\r\nModelul se poate folosi atat pentru competite cat si pentru antrenament\r\nNoua textura originala, face ca suprafata de contact cu mana sa fie mai mare cu 95%, in comparatie cu suprafetele conventionale.',5),
(5,'individual','minge','baschet','sala',40,'no name',360,'Panou baschet plexiglas, transparent, 180 x 105 cm\r\n\r\n    Panou baschet plexiglas, transparent;\r\n    Dimensiune 180 x 105 cm;\r\n    Grosime 10 mm;\r\n    Marcaje albe;\r\n    Fabricat din plexic, transparent;\r\n    Cu decupaj pentru inel;\r\n    Conform reglementarilor FIBA;',6),
(6,'individual','racheta','tenis de camp','vara',40,'adidas',240,'Racheta tenis copii',7),
(7,'echipa','Drumetie TAMPA (h 960m)','drumetie','vara',36,'Excursie',50,'Ar fi si pacat sa stii ca din centrul orasului tau creste semet un muntisor si sa nu profiti de prezenta lui cat de des posibil.\r\nTraseul incepe de la Bastionul Tesatorilor cu marcaj banda albastra pe Drumul Cavalerilor pana in Saua Tampei, de unde continua pe triunghi galben pana pe varf. Coborarea\r\nse face pe Drumul Serpentinelor, pe marcaj triunghi rosu, pana la statia de jos a telecabinei.\r\nDistanta totala a traseului este de 6 km.',8),
(8,'contact','Casca protectie box','contact','sala',40,'Zeus',250,'Casca de protectie pentru box VESUVIO de la ZEUS.\r\nMaterial: piele\r\nMarime UNICA\r\n',9),
(9,'contact','Manusi box','contact','sala',40,'Zeus',250,'Manusi de box VESUVIO de la ZEUS pentru competitie si/sau antrenament.\r\nMaterial: piele',10),
(10,'individual','pantaloni','contact','primavara',40,'Puma',300,'Material textil exterior: 100% nailon',11);
